function update(category, subcategory){
   $.get("/v0/contents/node/code/NEWS--1733430397027?payloadOnly=true", function(data, status){
    if(data && data.length > 0){
      $('#content').html("");
       data.forEach(news=>{

        if( (category===news.category && (!subcategory || subcategory.length === 0)) || (category===news.category && news.subcategory === subcategory) ) {
          var newsCard = '<div class="container mt-5">'+
            '    <div class="card">'+
            '      <img src="/v0/contents/code/'+news.picture+'/file" class="card-img-top img-fluid" alt="'+news.title+'">'+
            '      <div class="card-body">'+
            '        <h5 class="card-title">'+news.title+'</h5>'+
            '        <p class="card-text"><small class="text-muted"'+news.author +' | '+news.date+'</small></p>'+
            '        <p class="card-text">'+news.shortDescription+'</p>'+
            '        <p class="card-text">'+news.content+'</p>'+
            '        <p class="card-text"><strong>Tags :</strong>'+news.tags+'</p>'+
            '      </div>'+
            '    </div>'+
            '  </div>';

             $('#content').append(newsCard);
         }
        });
    }
  });
}
function buildSite(){
    $.get("/v0/contents/code/JSON--1733207491670?payloadOnly=true", function(data, status){
     console.log(data);
     if(data && data.siteName){
       $('#site_name').html(data.siteName);
       $('#site_url_name').html(data.siteName);
       $('#site_description').html(data.description);
     } 
     if(data && data.footer){
       $('#footer_name').html(data.siteName);
       $('#footer_description').html(data.footer.about);

        if(data.footer && data.footer.contact && data.footer.contact.socialMedia ){
        $('#social_medias').html("");
        data.footer.contact.socialMedia.forEach(media=>{
          $('#social_medias').append('<a href="'+media.link+'" class="text-white me-3">'+media.platform+'</a>');
        });
     }
    }
     if(data && data.categories){
        $('#menuPrincipal').html("");
        var itemContent = "";
         data.categories.forEach(itemMenu=>{


             if(itemMenu.name){
                 itemContent+='<li class="nav-item dropdown">'+ 
                  '<a class="nav-link dropdown-toggle" onclick="update(\''+itemMenu.name+'\',\'\')" id="'+itemMenu.name+'" role="button" data-bs-toggle="dropdown" aria-expanded="false">'+itemMenu.name+'</a>';

                  if(itemMenu && itemMenu.subcategories){
                      itemContent +='<ul class="dropdown-menu" aria-labelledby="'+itemMenu.name+'">';
                      itemMenu.subcategories.forEach(itemSubMenu=>{
                         itemContent += '<li><a class="dropdown-item" onclick="update(\''+itemMenu.name+'\',\''+itemSubMenu.name+'\')">'+itemSubMenu.name+'</a></li>';
                      });
                      itemContent += '</ul>';
                }

                itemContent += +'</li>';
             }
         });


        $('#menuPrincipal').append(itemContent);
     }
    });
}
buildSite();
